using System;
using System.Collections.Generic;

namespace ALICE_Events
{
    public class Event_Loadout : Event_Base
    {
        public Event_Loadout()
        {
            Name = "Loadout";
        }

        public void Logic()
        {
            if (Manager.WriteVariables && WriteVariables)
            {
                try
                {
                    Variables_Clear();
                    Variables_Generate();
                    Variables_Write();
                }
                catch (Exception ex)
                {
                    Internal.Exception(Name, "An Exception Occured While Updating Variables");
                    Internal.Exception(Name, "Exception: " + ex);
                }
            }

            //GameState.Logic_Loadout((Loadout)GetEvent());

            TriggerEvent();
        }

        public void Variables_Generate()
        {
            Loadout Event = (Loadout)Manager.GetEvent(Name);

            Variables.Clear();

            #region Custom Variables

            #endregion

            #region Event Variables
            Variable_Craft("Ship", Event.Ship.ToString());
            Variable_Craft("ShipID", Event.ShipID.ToString());
            Variable_Craft("ShipName", Event.ShipName.ToString());
            Variable_Craft("ShipIdent", Event.ShipIdent.ToString());
            Variable_Craft("HullValue", Event.HullValue.ToString());
            Variable_Craft("ModulesValue", Event.ModulesValue.ToString());
            Variable_Craft("HullHealth", Event.HullHealth.ToString());
            Variable_Craft("UnladenMass", Event.UnladenMass.ToString());
            Variable_Craft("CargoCapacity", Event.CargoCapacity.ToString());
            Variable_Craft("MaxJumpRange", Event.MaxJumpRange.ToString());
            Variable_Craft("FuelCapacity", Event.FuelCapacity.ToString());
            Variable_Craft("Rebuy", Event.Rebuy.ToString());
            Variable_Craft("Modules", Event.Modules.ToString());
            #endregion
        }
    }

    #region Loadout Event
    public class Loadout : Base
    {
        public string Ship { get; set; }
        public decimal ShipID { get; set; }
        public string ShipName { get; set; }
        public string ShipIdent { get; set; }
        public decimal HullValue { get; set; }
        public decimal ModulesValue { get; set; }
        public decimal HullHealth { get; set; }
        public decimal UnladenMass { get; set; }
        public decimal CargoCapacity { get; set; }
        public decimal MaxJumpRange { get; set; }
        public string FuelCapacity { get; set; }
        public decimal Rebuy { get; set; }
        public string Modules { get; set; }
    }
    #endregion
}


